import React from "react";
// import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import Logo from "../Logo/Logo";
import "./Header.scss";

class Header extends React.Component {
  render() {
    return (
      <nav>
        <ul className="haut">
          <Logo />
          <li>
            <a href="#">SHOP</a>
          </li>
          <li>
            <a href="#">CONTACT</a>
          </li>
          <li>
            <a href="#">RECHERCHE</a>
          </li>
          <li id="connexion">
            <a href="#">CONNEXION</a>
          </li>
        </ul>
      </nav>
    );
  }
}

export default Header;
